import Menu from '../components/menu';

export default function Ditastore() {
    return (
        <div>
            <Head>
                <title>Dita Store</title>
            </Head>
            <Menu />
                <div>
                    <h1>Dita Store</h1>
                    <h4>Pusat Perbelanjaan Wanita Mulai dari 
                        tas, sepatu dan pakaian wanita
                    </h4>

                </div>
        </div>
    );
}
